import React from 'react';
import { getSuggestions } from '../suggestions';  // Ensure the correct path

const TravelerWeather = ({ weatherData, weather, city, windData }) => {
  const suggestion = getSuggestions(weather, 'traveler');

  return (
    <div className='weatherData'>
      <div className='currtemp'>
        <div className='tempAndLogo'>
          <div>
            <img src={`assets/${weather.icon}.svg`} width={200} alt='icon' />
          </div>
          <div>
            {Math.round(weatherData.temp)}&deg;C
            <p>{weather.description}</p>
          </div>
        </div>
        <div className='windData'>
          <p>Wind: <span>{windData.speed} mph</span></p>
          <p>Sunrise: <span>{new Date(city.sunrise * 1000).toLocaleTimeString()}</span></p>
          <p>Sunset: <span>{new Date(city.sunset * 1000).toLocaleTimeString()}</span></p>
        </div>
      </div>
      <div className='suggestion'>
        <h3>Suggestion:</h3>
        <p>{suggestion}</p>
      </div>
    </div>
  );
};

export default TravelerWeather;
